import "./RadioButtons.css";

import Panel from "components/Panel/Panel";
import Input from "components/Input/Input";

const RadioButtons = () => {
  return (
    <Panel>
      <form>
        <div>
          <input type="radio" category="fruits" value="Apple" label="Apple" checked/>
        </div>
      </form>
    </Panel>
  )
};

export default RadioButtons;
